import React from "react";
import { Route, Switch } from "react-router-dom";
import About from "./About";
import Contact from "./Contact";
import Navbar from "./Navbar";

function App() {
    return (
        <>
            <About />
            <Contact />
            <Navbar />
        </>
    )
}

export default App;
